import React, { useState } from "react";
import axios from "axios";
import { useNavigate, Link } from "react-router-dom";
import "./Login.css";

export default function Login() {
  const [activeForm, setActiveForm] = useState("signUp");
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [confirmpassword, setconfirmPassword] = useState("");
  const navigate = useNavigate();

  async function signUpClick(e) {
    e.preventDefault();

    try {
      await axios("http://localhost:4000/user/save", {
        action: " ",
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        data: JSON.stringify({
          name: name,
          email: email,
          password: password,
          confirmpassword: password,
        }),
      });
      setActiveForm("logIn"); 
    } catch (e) {
      console.log(e);
    }
  }

  async function logInClick(e) {
    e.preventDefault();

    try {
      const res = await axios("http://localhost:4000/user/find", {
        action: " ",
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        data: JSON.stringify({
          email: email,
          password: password,
        }),
      });
      if (res.status === 200) {
        navigate("/dashboard");
      }
    } catch (e) {
      console.log(e);
    }
  }

  return (
    <div>
      <div className="container">
        <div id="quizzieBox">
          <h1>Quizzie</h1>

          <div className="slides">
            <div className="slidesHead">
              <div className="inline">
                <button
                  id="signUpButton"
                  onClick={() => setActiveForm("signUp")}
                  className={activeForm === "signUp" ? "activeButton" : ""}
                >
                  Sign Up
                </button>
              </div>
              <div className="inline">
                <button
                  id="logInButton"
                  onClick={() => setActiveForm("logIn")}
                  className={activeForm === "logIn" ? "activeButton" : ""}
                >
                  Log In
                </button>
              </div>
            </div>

            <div className="slidesBody">
              {activeForm === "logIn" && (
                <div className="logIn inline">
                  <div>
                    <p className="inline emailin">Email</p>
                    <input
                      type="email"
                      value={email}
                      onChange={(e) => {
                        setEmail(e.target.value);
                      }}
                    ></input>
                  </div>
                  <div>
                    <p className="inline passin">Password</p>
                    <input
                      type="password"
                      value={password}
                      onChange={(e) => {
                        setPassword(e.target.value);
                      }}
                    ></input>
                  </div>
                  <div>
                    <button
                      type="submit"
                      className="blueButton"
                      onClick={(e) => logInClick(e)}
                    >
                      log In
                    </button>
                  </div>
                </div>
              )}
              {activeForm === "signUp" && (
                <div className="inline signUp">
                  <div>
                    <p className="inline name">Name</p>
                    <input
                      type="text"
                      value={name}
                      onChange={(e) => {
                        setName(e.target.value);
                      }}
                    ></input>
                  </div>
                  <div>
                    <p className="inline email">Email</p>
                    <input
                      type="email"
                      value={email}
                      onChange={(e) => {
                        setEmail(e.target.value);
                      }}
                    ></input>
                  </div>
                  <div>
                    <p className="inline pass">Password</p>
                    <input
                      type="password"
                      value={password}
                      onChange={(e) => {
                        setPassword(e.target.value);
                      }}
                    ></input>
                  </div>
                  <div>
                    <p className="inline confpass">Confirm Password</p>
                    <input
                      type="password"
                      value={confirmpassword}
                      onChange={(e) => {
                        setconfirmPassword(e.target.value);
                      }}
                    ></input>
                  </div>
                  <div>
                    <button
                      type="submit"
                      className="blueButton"
                      onClick={(e) => signUpClick(e)}
                    >
                      Sign Up
                    </button>
                  </div>
                </div>
              )}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
